class Solution:
    def generateParenthesis(self, n: int) -> List[str]:
        def dfs(left: int, right: int) -> None:
            if right == 0:
                nonlocal ans
                ans.append("".join(path))
                return
            if left == 0 or left < right:
                path.append(")")
                dfs(left, right - 1)
                path.pop()
            if left > 0:
                path.append("(")
                dfs(left - 1, right)
                path.pop()

        ans = []
        path = []
        dfs(n, n)
        return ans

